import React from 'react';

function Square(props) {
    let boxColor = 'whiteBox'
    props.count += -1
    if (props.val === 1) {
        boxColor = 'blackBox'
        props.count += 1
    }

    return (
        <div className={boxColor} onClick={() => props.click(props.x, props.y)}>

        </div>
    );
}
export default Square;
